INSERT INTO `film` (`Id`, `Titre`, `Duree`, `Datesortie`, `Budget`, `Recette`, `Norea`, `Catid`, `image`, `note`, `description`) VALUES
(3, 'La grande vadrouille', 132, '1966-12-01', 7227000, 51258000, 2, 'AC', '', '9.7', 'Deuxième comédie de Gérard Oury après Le Corniaud, le film se déroule durant la Seconde Guerre mondiale dans la France occupée et raconte les déboires de deux Français — totalement opposés par leurs caractères et leurs origines sociales — se retrouvant obligés d\'aider un petit groupe d\'aviateurs britanniques à se rendre en zone libre, tout en étant poursuivis par les Allemands. Ces deux Français sont interprétés par Bourvil et Louis de Funès, duo vedette du Corniaud, qui jouent respectivement un peintre en bâtiment un peu naïf et un chef d\'orchestre de l\'Opéra de Paris très acariâtre et imbu de sa personne. ');
INSERT INTO `film` (`Id`, `Titre`, `Duree`, `Datesortie`, `Budget`, `Recette`, `Norea`, `Catid`, `image`, `note`, `description`) VALUES
(16, 'Le Corniaud', 105, '1965-06-01', 5000000, 65000000, 3, 'Av', '', '6.0', 'Son scénario s\'inspire d\'un des épisodes du démantèlement de la « French Connection », l\'affaire Jacques Angelvin, lorsqu\'un présentateur de la télévision française fut arrêté aux États-Unis en 1962 au volant d\'une Buick Invicta provenant de France et dans laquelle plus de cinquante kilogrammes d\'héroïne pure avaient été dissimulés et qui clama son innocence en prétendant avoir été dupé. '),
(18, 'Spider-Man : New Generation', 157, '2021-08-05', 89000, 560090, 17, 'AC', '', '7.0', 'SPIDER-MAN : NEW GENERATION présente Miles Morales, un adolescent vivant à Brooklyn, et révèle les possibilités illimitées du Spider-Verse, un univers où plus d’un peut porter le masque… '),
(19, 'Bohemian Rhapsody', 215, '2020-05-14', 90990, 546000, 25, 'Av', '', '6.8', 'Du succès fulgurant de Freddie Mercury à ses excès, risquant la quasi-implosion du groupe, jusqu’à son retour triomphal sur scène lors du concert Live Aid, alors qu’il était frappé par la maladie, découvrez la vie exceptionnelle d’un homme qui continue d’inspirer les outsiders, les rêveurs et tous ceux qui aiment la musique. ');
INSERT INTO `film` (`Id`, `Titre`, `Duree`, `Datesortie`, `Budget`, `Recette`, `Norea`, `Catid`, `image`, `note`, `description`) VALUES
(20, 'Iron Man 1', 205, '2019-06-19', 19000000, 780000000, 15, 'AC', '', '7.8', 'Iron Man est un film américain réalisé par Jon Favreau, sorti en 2008. Il raconte les origines et les débuts du personnage éponyme issu du comics publié par Marvel. Il s\'agit de la première étape de l\'univers cinématographique Marvel, dont la première partie, appelée « Phase un » s\'est terminée en 2012 avec Avengers de Joss Whedon. ');
INSERT INTO `film` (`Id`, `Titre`, `Duree`, `Datesortie`, `Budget`, `Recette`, `Norea`, `Catid`, `image`, `note`, `description`) VALUES
(21, 'Mission impossible', 234, '2001-01-03', 3000000, 45900000, 17, 'AC', '', '5.0', 'Mission impossible est une série cinématographique américaine, inspirée de la série télévisée éponyme mettant en vedette depuis 1996 Tom Cruise dans le rôle de Ethan Hunt ainsi que des personnages récurrents tels Simon Pegg ou Ving Rhames.');

